          <UpdateGuest guest={editingGuest} setEditingGuest={setEditingGuest} />
        ) : (
          <ListGuest
            onAddNew={() => setIsCreating(true)}
            onEditGuest={(guest) => setEditingGuest(guest)}
          />
        )} */}

        {/* <ListPaymentStatus /> */}
      </div>
    </>
  );
}

export default PaymentStatuses;
